import React from 'react'

const AddEmployee = () => {
  return (
    <div class="mx-auto max-w-lg items-center">
      <div>
        <div className="px-3 py-6 text-center bg-green-600 font-sans tracking-tighter text-white font-thin">
          Add New Employee
        </div>
        <div class="bg-slate-200">
          <label className="block w-full px-4 font-extralight ">Name</label>
          <input class="px-4 py-2 w-3/4 rounded mx-4 my-2 bg-white" type='text'></input>
        </div>
     </div>
    </div>
  );
};

export default AddEmployee;
